parts:
{
  "name": "UBX-NAV-SBAS",
  "description": "SBAS status data",
  "class_id": "0x01",
  "message_id": "0x32",
  "message_type": "periodic_polled",
  "payload_length": {
    "variable": {
      "base": 12,
      "formula": "12 + cnt*12"
    }
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "name": "geo",
      "data_type": "U1",
      "description": "PRN Number of the GEO where correction and integrity data is used from"
    },
    {
      "byte_offset": 5,
      "name": "mode",
      "data_type": "U1",
      "description": "SBAS Mode"
    },
    {
      "byte_offset": 6,
      "name": "sys",
      "data_type": "I1",
      "description": "SBAS System (WAAS/EGNOS/...)"
    },
    {
      "byte_offset": 7,
      "name": "service",
      "data_type": "X1",
      "description": "SBAS Services available",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_size": 1,
          "name": "Ranging",
          "description": "GEO may be used as ranging source"
        },
        {
          "bit_offset": 1,
          "bit_size": 1,
          "name": "Corrections",
          "description": "GEO is providing correction data"
        },
        {
          "bit_offset": 2,
          "bit_size": 1,
          "name": "Integrity",
          "description": "GEO is providing integrity"
        },
        {
          "bit_offset": 3,
          "bit_size": 1,
          "name": "Testmode",
          "description": "GEO is in test mode"
        },
        {
          "bit_offset": 4,
          "bit_size": 1,
          "name": "Bad",
          "description": "Problem with signal or broadcast data indicated"
        },
        {
          "bit_offset": 5,
          "bit_size": 3,
          "name": "reserved",
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 8,
      "name": "cnt",
      "data_type": "U1",
      "description": "Number of SV data following"
    },
    {
      "byte_offset": 9,
      "name": "reserved0",
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "reserved": true
    },
    {
      "byte_offset": 12,
      "name": "svData",
      "data_type": "ARRAY",
      "count_field": "cnt",
      "elements": [
        {
          "byte_offset": 0,
          "name": "svid",
          "data_type": "U1",
          "description": "SV ID"
        },
        {
          "byte_offset": 1,
          "name": "flags",
          "data_type": "U1",
          "description": "Flags for this SV"
        },
        {
          "byte_offset": 2,
          "name": "udre",
          "data_type": "U1",
          "description": "Monitoring status"
        },
        {
          "byte_offset": 3,
          "name": "svSys",
          "data_type": "U1",
          "description": "System (WAAS/EGNOS/...) same as SYS"
        },
        {
          "byte_offset": 4,
          "name": "svService",
          "data_type": "U1",
          "description": "Services available, same as SERVICE"
        },
        {
          "byte_offset": 5,
          "name": "reserved1",
          "data_type": "U1",
          "reserved": true
        },
        {
          "byte_offset": 6,
          "name": "prc",
          "data_type": "I2",
          "unit": "cm",
          "description": "Pseudo Range correction in [cm]"
        },
        {
          "byte_offset": 8,
          "name": "reserved2",
          "data_type": {
            "array_of": "U1",
            "count": 2
          },
          "reserved": true
        },
        {
          "byte_offset": 10,
          "name": "ic",
          "data_type": "I2",
          "unit": "cm",
          "description": "Ionosphere correction in [cm]"
        }
      ]
    }
  ]
}
